import React from 'react';
export default class Login extends React.Component{

constructor() {
    super()
    this.state = {
    username: '',
    password: '',
    isLogined: false
    }
}

handleInputChange = (event) => {
this.setState({
    [event.target.name]: event.target.value
    })
}

submitClick=() =>
{
    if((this.state.username=="krishankantsinghal") &&   (this.state.password=="krishankant123"))
    {
        this.setState({isLogined:true});
    }
}

render() {
    return (
        <div className="wrapper fadeInDown">
            <form>
                <input type="text" name="username" hint="username" className="fadeIn second" onChange=    {this.handleInputChange} />
                <input type="password" name="password" hint="password" className="fadeIn third" onChange={this.handleInputChange} />
                <input type="submit" name="submit" className="fadeIn fourth" value="Login" onClick={this.submitClick}/>
            </form>
        </div>
        );
    }
}
